  return <ReactPlayer url={url} />;
};

export default {
  name: "embedPlayer",
  title: "Video Embed",
  type: "object",
  icon: MdVideoLibrary,
  fields: [
    {
      name: "url",
      title: "URL",
      type: "url",
    },
  ],
  preview: {
    select: {
      url: "url",
    },
    component: VideoEmbed,
  },
};

